var routeSelect=document.querySelector(".route-module__select"),alphabet=document.querySelector(".alphabet");routeSelect.addEventListener("click",function(e){e.preventDefault(),routeSelect.classList.contains("route-module__select--active")?(routeSelect.classList.remove("route-module__select--active"),alphabet.classList.remove("alphabet--show")):(routeSelect.classList.add("route-module__select--active"),alphabet.classList.add("alphabet--show"))});